import './Expenses.css'

function Expenses(props){
    const title = props.title;
    const amount = props.amount.toLocaleString('en-US', {
        style: 'currency',
        currency: 'USD'
    });

    return (
        <div className="expenses">
            <div>{title}</div>
            <div>{amount}</div>
        </div>
    )

}

export default Expenses;
